import React from 'react';
import './Home.css';

import Nav from './Nav.js'
import About from './About';
import EndProgram from './ETE';
import Why from './Why';
import Speakers from './Speakers';



function Home() {
  return (
    <div className='head'>
      <Nav/>
      
      <About/>
      <EndProgram/>
      <Why/>    
      <header className='head2'>
    <h2><strong>Speakers</strong></h2>
    </header> 
      <div className='mains'>
        <div className='1'>
    < Speakers no={1} name=" Ajay Prakash Sawhney " about="Secretary. Ministry of Electronics" about1="Government of India" img="" /></div>
    < Speakers no={2} name=" " img="/" />
    < Speakers no={3} name=" Ajay Prakash Sawhney " about="Secretary. Ministry of Electronics" about1="Government of India" img="" /> />
    < Speakers no={4} name=" Ajay Prakash Sawhney " about="Secretary. Ministry of Electronics" about1="Government of India" img="" /> />
    < Speakers no={5} name=" Ajay Prakash Sawhney " about="Secretary. Ministry of Electronics" about1="Government of India" img="" /> />

    </div>

    </div>

    
      
    
      
  )

}

export default Home
